import React from 'react';
import Styles from './Home.module.css';
import Card from '../Card/Card';
import cx from 'classnames';
import {CSSTransition} from 'react-transition-group';
const Home = ()=>{
    return (
        <div className = {Styles.container}>
        <CSSTransition>
            <Card></Card>
        </CSSTransition>
        
        </div>
   
    )
}
export default Home;
